import React from 'react';

function Header() {
  return (
    <header style={{
      background: '#026c20ff',
      color: '#fff',
      padding: '1rem',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    }}>

      <h1 style={{
        fontFamily: `'Brush Script MT'`,
        fontSize: '3.5rem',
        letterSpacing: '2px',
        textShadow: '2px 2px 8px #00000033',
        margin: 0
      }}>
        Lyd's Art
      </h1>
    </header>
  );
}

export default Header;
